import Link from 'next/link';

const linkStyle = {
    marginRight: 15
  };

  const Title = styled.a`
    font-size: 1.5em;
    text-align: center;
    color: palevioletred;
  `;
  
  const Header = () => (
    <div>
      <Link href="/">
        <a style={linkStyle}>Latest posts</a>
      </Link>
      <Link href="/new">
        <a style={linkStyle}>New post</a>
      </Link>
    </div>
  );
  
  export default Header;
